    {
        id: 1,
        icon: <FiHome></FiHome>,

    },
    {
        id: 2,
        icon: <FiMap></FiMap>,

    },
    {
        id: 3,
        icon: <FiShoppingBag></FiShoppingBag>,

    },
    {
        id: 4,
        icon: <FiDollarSign></FiDollarSign>,

    },
];
const InformationStore = () => {
    return (
        <div>
            {LinkList.map((item))}
